import{_ as e,W as a,X as t,Y as r}from"./framework-a0cce298.js";const i={},c=r('<h2 id="是什么" tabindex="-1"><a class="header-anchor" href="#是什么" aria-hidden="true">#</a> 是什么？</h2><p>该项目主要记录我这一路走来的Java学习笔记&amp;工作总结，随着自己对某一项知识/技术的认知加深、也在不断的推翻完善中...</p><h2 id="为什么写" tabindex="-1"><a class="header-anchor" href="#为什么写" aria-hidden="true">#</a> 为什么写？</h2><blockquote><p>学习笔记模块的内容很多是基于网上的内容转载/二创。那为什么还要写笔记？</p></blockquote><ul><li>融入自己的想法</li></ul><p>笔记并不是全盘摘抄、更需要融入自己对这块知识点的看法。有些博客内容并不一定全对（存在错误、过时、好坏参半）、这些都需要自己重新整理与思考，才能更好的消化。</p><ul><li>更好的记忆与吸收知识</li></ul><p>把零散的、大篇幅的知识，逻辑梳理出来，重难点突出出来，从而更好的将知识记住。</p><p>且知识需要不断复习、加深记忆。如果每次都从网上找，那每次都是新篇章</p><h2 id="参考与鸣谢" tabindex="-1"><a class="header-anchor" href="#参考与鸣谢" aria-hidden="true">#</a> 参考与鸣谢</h2><p>本项目的内容主要来自于自己的工作总结，读书笔记，以及对网上博客文章进行整理与总结。希望以最明了易懂的方式呈现出java技术架构，以便轻松应对面试</p>',11),d=[c];function n(h,l){return a(),t("div",null,d)}const s=e(i,[["render",n],["__file","index.html.vue"]]);export{s as default};
